Bolo de chocolate saudável e fácil de fazer pra comer até dizer chega ! 

Primeiramente aqueça o forno a 180 ° C. Depois misture todos os ingredientes e coloque em uma forma com papel manteiga. Leve ao forno por 35 minutos. 

 Ingredientes : 
3 bananas ; 
3 ovos ; 
1 /2 xícara de cacau sem açúcar ; 
1/2 xícara de manteiga de amendoim ; 
1/4 xícara de farinha ( usei amêndoa ) ; 
2 colheres de chá de fermento em pó ;
1/4 xícara de gotas de chocolate sem açúcar .

Aproveite! Quando fizer me fala  o que você achou 😉

